import React, { useState } from 'react';

function Contacts() {
  let api = "http://127.0.0.1:8090/api/collections/contacts/records/";
  const profiles = [];

fetch(api)
.then(response => response.json())
.then(data => {
    profiles = data.items;
    // getContacts(profiles);
});


  return (
    <>
    <div>{api}</div>
    <div>{profiles}</div>
    </>
  );
  };

export default Contacts;
